import Layout from '../components/layout';
import About from '../components/home/about';
import ImgBanner from '../components/ui/imgBanner';
import styled from 'styled-components';
import TitleBanner from '../components/ui/titleBanner';

const Styled = styled.section`
  display: grid;
  text-align: center;
`;

// import Link from 'next/link';

const IndexPage = () => (
  <Layout heroSize={true} banner='home'>
    <About />
    <ImgBanner
      title='PRIVATE EVENTS'
      subtile='Planning a party? Let us do the work'
      btnTitle='view more'
      toLink='/privateEvents'
    />
    <Styled className='event section'>
      <img src='/event.png' alt='live music img' />
      <div className='event--content'>
        <TitleBanner
          topTitle='live music'
          title='Music & Event Inquiries'
          botTitle='get your jam on'
        />
        <p className='about--content--text'>
          Simone's is a unique bar and grill located in the Pilsen neighborhood
          of Chicago, Illinois. It's a great place to grab a craft beer,
          cocktail and quality grub. We are also proud to feature local and
          national music talent, gallery and private events.
        </p>
      </div>
    </Styled>
  </Layout>
);

export default IndexPage;
